import React, { useEffect, useState } from "react";
// ... other imports

const SubSubcategoryPage = () => {
  // ... other code

  useEffect(() => {
    const fetchSubSubcategories = async () => {
      try {
        const response = await axios.get(
          `http://localhost:8080/api/subsubcategories/${subcategoryId}`
        );

        console.log("API Response:", response.data); // Log the raw response

        const subSubcategoriesData = response.data || []; // Handle potential null/undefined
        setSubSubcategories(subSubcategoriesData);
        console.log("Sub-Subcategories State:", subSubcategories); // Log the state after setting it

      } catch (err) {
        console.error("Error fetching sub-subcategories:", err); // Log the error object
        setError("Error fetching sub-subcategories");
      } finally {
        setLoading(false);
      }
    };

    fetchSubSubcategories();
  }, [subcategoryId]);

  // ... other code

  console.log("SubSubcategoryPage Render - subSubcategories:", subSubcategories); // Log in the render method

  // ... rest of the component
};

export default SubSubcategoryPage;
